
<!doctype html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <style>
    :root {
      --gold: #c9a227;
      --gold-fill: #d9bd67;
      --text-default: #c9a227;
      --text-hover: #2c3e50;
      --lift-shape: -6px;
      --lift-text: -12px;
      --hover-duration: .3s;
      --hover-ease: cubic-bezier(.2,.6,.2,1);
    }
    html, body { margin: 0; padding: 0; }
    .map-wrap { max-width: 1200px; margin: 0 auto; padding: 12px; }
    svg { display:block; width:100%; height:auto; }
    .county-svg {
      transition:
        transform var(--hover-duration) var(--hover-ease),
        fill var(--hover-duration) var(--hover-ease),
        stroke var(--hover-duration) var(--hover-ease),
        filter var(--hover-duration) var(--hover-ease);
      cursor: pointer;
    }
    .county-text {
      fill: var(--text-default);
      transition: transform var(--hover-duration) var(--hover-ease),
                  fill var(--hover-duration) var(--hover-ease);
      pointer-events: none;
    }
    /* Hover shape */
    .county-svg:hover {
      stroke: var(--gold);
      stroke-width: 2px;
      fill: var(--gold-fill);
      filter: drop-shadow(0 0 4px rgba(201,162,39,.55));
      transform: translateY(var(--lift-shape));
    }
    /* Hover text (move stronger + color change) */
    g:hover .county-text {
      transform: translateY(var(--lift-text));
      fill: var(--text-hover);
    }
  </style>
</head>
